// src/pages/RegisterSupplier.jsx
import React, { useState } from "react";
import { Container, Form, Button } from "react-bootstrap";
import axios from "axios";
import { useNavigate } from "react-router-dom";

/**
 * Local mapping must match backend AREAS keys exactly.
 */
const AREAS = {
  "JP Nagar": { lat: 12.9079096, lng: 77.5931893 },
  "KR Market": { lat: 12.9718915, lng: 77.5955648 },
  "BTM Layout": { lat: 12.9250, lng: 77.5938 },
  "Banashankari": { lat: 12.9252, lng: 77.5582 },
  "Silk Board": { lat: 12.9279, lng: 77.5838 },
  "Majestic": { lat: 12.9754, lng: 77.5714 },
  "Electronic City": { lat: 12.8400, lng: 77.6601 },
};

function RegisterSupplier() {
  const [form, setForm] = useState({
    username: "",
    password: "",
    name: "",
    phone: "",
    pricePerUnit: "",
    availableUnits: "",
    renewable: false,
    areaName: "JP Nagar",
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setForm({ ...form, [name]: type === "checkbox" ? checked : value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!form.username || !form.password || !form.name || !form.phone) {
      alert("Please fill required fields");
      return;
    }

    if (!form.renewable) {
      alert("Supplier must confirm renewable energy usage.");
      return;
    }

    try {
      await axios.post("http://localhost:5000/api/auth/register/supplier", {
        username: form.username,
        password: form.password,
        name: form.name,
        phone: form.phone,
        renewable: form.renewable,
        pricePerUnit: Number(form.pricePerUnit || 0),
        availableUnits: Number(form.availableUnits || 0),

        // MUST MATCH BACKEND KEY
        area: form.areaName,
      });

      alert("Supplier registered successfully!");
      navigate("/login");
    } catch (err) {
      console.error("Register supplier error:", err.response?.data || err.message);
      alert(err.response?.data?.message || "Registration failed");
    }
  };

  return (
    <Container className="mt-5" style={{ maxWidth: "600px" }}>
      <h2 className="text-center mb-4">Register as Supplier</h2>

      <Form onSubmit={handleSubmit}>
        {[
          ["username", "text"],
          ["password", "password"],
          ["name", "text"],
          ["phone", "text"],
          ["pricePerUnit", "number"],
          ["availableUnits", "number"],
        ].map(([field, type], idx) => (
          <Form.Group className="mb-3" key={idx}>
            <Form.Label>{field}</Form.Label>
            <Form.Control
              required
              type={type}
              name={field}
              value={form[field]}
              onChange={handleChange}
            />
          </Form.Group>
        ))}

        <Form.Group className="mb-3">
          <Form.Label>Select Area</Form.Label>
          <Form.Select name="areaName" value={form.areaName} onChange={handleChange}>
            {Object.keys(AREAS).map((area) => (
              <option key={area} value={area}>
                {area}
              </option>
            ))}
          </Form.Select>
          <Form.Text className="text-muted">
            We will save the selected area (and its predefined coordinates).
          </Form.Text>
        </Form.Group>

        <Form.Group className="mb-3">
          <Form.Check
            type="checkbox"
            name="renewable"
            checked={form.renewable}
            onChange={handleChange}
            label="I use renewable energy (required)"
          />
        </Form.Group>

        <Button variant="success" type="submit" className="w-100">
          Register
        </Button>
      </Form>
    </Container>
  );
}

export default RegisterSupplier;
